import React from 'react';
import './App.css';
import Header from './components/Header.jsx';

function App() {
  return (
    <div className="min-h-screen bg-gray-50">
      <Header />
      <div className='flex justify-center'>
        <div className='flex-col justify-center'>
          <h1 className='text-4xl font-bold mt-20'>Welcome to EQUI</h1>
          <p className='text-lg mt-4'>EQUI is a platform that helps you manage your tasks and projects. It is designed to help you organize your work and collaborate with your team.</p>
          <button className='bg-black text-white px-4 py-2 rounded-lg hover:bg-gray-800 mt-4'>Get Started</button>
        </div>
      </div>
    </div>
  );
}

export default App;
